Selected_Banker_Rank_by_Referral_Convers.query:
q = load "${App.Datasets.RBDemoLead.FullyQualifiedName}";
q = filter q by 'ISREFERRAL' == "True";
q = filter q by date('CREATEDDATE_Year', 'CREATEDDATE_Month', 'CREATEDDATE_Day') in ["current quarter".."current day"];
processed = filter q by 'OPENPROCESSEDSTATUS' == "Processed";
converted = filter q by 'ISCONVERTED' == "true";
result = group processed by 'OWNERUNIQUEUSERNAME' full, converted by 'OWNERUNIQUEUSERNAME';
result = foreach result generate coalesce(processed.'OWNERUNIQUEUSERNAME', converted.'OWNERUNIQUEUSERNAME') as 'OWNERUNIQUEUSERNAME', count(converted)/count(processed) as 'Conversion_Rate';
result = group result by 'OWNERUNIQUEUSERNAME';
